webpackJsonp([301],{"./node_modules/json-loader/index.js!./.cache/json/articles-miscellaneous-learn-about-php-array.json":function(a,e){a.exports={data:{markdownRemark:{html:"<h1>PHP Array</h1>\n<pre><code>Array Can Store multiple values in single Varible. \nlet's think that you have a list of cars like ( 'BMW', 'Honda', Swift, 'XUV' )\n\nbut you want to separate this by categories like sport car, xuv. \nbut you need to put it in a single varible then you need two arrays\n\n## Let's Solve this By Programming\n\n   &#x3C;?php\n          $sport_cars = array('BMW', 'Honda');\n          $xuv_cars = array('Swift', 'XUV');\n          echo \"Sport Cars List: \" . $sport_cars[0] . \", \" . $sport_cars[1] . \".\";\n          echo \"XUV Cars List: \" . $xuv_cars[0] . \", \" . $xuv_cars[1] . \".\";\n    ?>\n\nOutput:\n    Sport Cars List: BMW, Honda.\n    XUV Cars List: Swift, XUV.\n</code></pre>\n<p>Note That: array is Index from 0 to n you can access each value by passing there<br>\nindex number to variable like follows</p>\n<pre><code>echo $sport_cars[0];\n\noutput:\n    BMW\n</code></pre>\n<p>Like That you can access the element in array</p>",frontmatter:{title:"Learn About Php Array",parent:"/home/stuart/guides/src/pages/articles/miscellaneous/learn-about-php-array/index.md absPath of file"}}},pathContext:{slug:"/articles/miscellaneous/learn-about-php-array/"}}}});
